css:
:host,
.atom-text-editor {
  background-color: #222;
  color: #dedede;
}
:host .invisible-character,
.atom-text-editor .invisible-character {
  color: #464646;
}
:host .gutter,
.atom-text-editor .gutter {
  color: #bcbcbc;
}
:host .gutter .line-number,
.atom-text-editor .gutter .line-number {
  opacity: 1;
}
:host .gutter .line-number:after,
.atom-text-editor .gutter .line-number:after,
:host .fold-marker:after,
.atom-text-editor .fold-marker:after {
  color: #d33682;
}
:host .cursor,
.atom-text-editor .cursor {
  border-color: #dedede;
}
:host .selection .region,
.atom-text-editor .selection .region {
  background-color: #555;
}
:host .line.cursor-line,
.atom-text-editor .line.cursor-line,
:host .line-number.cursor-line-no-selection,
.atom-text-editor .line-number.cursor-line-no-selection {
  background-color: #2e2e2e;
}
.bracket-matcher .region {
  background-color: #464646;
  border-bottom: none;
}
.comment {
  color: #7bae7b;
}
.comment .storage {
  color: #7bae7b;
  font-weight: bold;
}
.entity {
  color: #f2c23c;
}
.attribute-name {
  color: #e4cf94;
}
.keyword,
.storage,
.punctuation.parameters {
  color: #f4eeaf;
}
.keyword.control,
.parameter {
  color: #e4cf94;
}
.meta.brace,
.meta.curly {
  color: #477777;
}
.constant.numeric {
  color: #8cd0d3;
}
.constant.language {
  color: #f0dfaf;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #d48282;
}
.string .definition,
.string .constant.character.escape {
  color: #a95f5f;
}
.regexp .keyword {
  color: #ea7676;
}
.text.html .entity.tag,
.text.xml .entity.tag,
.text.html .entity.attribute-name,
.text.xml .entity.attribute-name {
  color: #e4cf94;
}
.text.html .punctuation.tag,
.text.xml .punctuation.tag,
.text.html .doctype,
.text.xml .doctype {
  color: #a38636;
}
.source.json .constant.language {
  color: #f0dfaf;
}
.source.json .definition.array,
.source.json .definition.dictionary {
  color: #477777;
}
.source.json .separator.key-value {
  color: #f4eeaf;
}
.source.yaml .entity.tag {
  color: #e4cf94;
}
.source.yaml .entity.tag .punctuation {
  color: #dedede;
}
.source.yaml .constant .punctuation.definition {
  color: #dedede;
}
.source.css .attribute-name,
.source.sass .attribute-name,
.source.css .tag,
.source.sass .tag,
.source.css .attribute-name .entity,
.source.sass .attribute-name .entity,
.source.css .tag .entity,
.source.sass .tag .entity {
  color: #e4cf94;
}
.source.css .attribute-selector .definition,
.source.sass .attribute-selector .definition {
  color: inherit;
}
.source.css .operator.logic,
.source.sass .operator.logic {
  color: #e4cf94;
}
.source.css .punctuation.section,
.source.sass .punctuation.section {
  color: #477777;
}
.source.css .unit,
.source.sass .unit {
  color: #8cd0d3;
}
.source.css .constant.other,
.source.sass .constant.other,
.source.css .constant.property-value,
.source.sass .constant.property-value {
  color: #d48282;
}
.source.css .variable,
.source.sass .variable {
  color: #f4eeaf;
}
.source .markdown,
.source .gfm {
  -webkit-font-smoothing: auto;
}
.source.markdown .heading,
.source.gfm .heading,
.source.markdown .hr,
.source.gfm .hr {
  color: #f4eeaf;
}
.source.markdown .bold,
.source.gfm .bold,
.source.markdown .italic,
.source.gfm .italic {
  color: #f4eeaf;
}
.source.markdown .bold,
.source.gfm .bold {
  font-weight: bold;
}
.source.markdown .italic,
.source.gfm .italic {
  font-style: italic;
}
.source.markdown .link .entity,
.source.gfm .link .entity {
  color: #d48282;
}
.source.markdown .link .link,
.source.gfm .link .link {
  color: #f4eeaf;
}
.source.markdown .quote.support,
.source.gfm .quote.support {
  color: #f4eeaf;
  font-weight: bold;
}
.source.markdown .quote.comment,
.source.gfm .quote.comment {
  color: inherit;
}
.source.markdown .raw,
.source.gfm .raw,
.source.markdown .code .support.gfm,
.source.gfm .code .support.gfm {
  color: #8cd0d3;
}
.source.markdown .list,
.source.gfm .list {
  color: #f4eeaf;
  font-weight: bold;
}
